('02645733-ae9b-487c-a055-e54af9048969', 'Ở ghép trọn gói 700k gần Lotte Mart', '3', 'WOT6', 'Địa chỉ: 34 Phố số 36, Phường Tân Quy, Quận 7, Hồ Chí Minh', 'dc16f80e-04a6-4f69-a07c-4d5e7a73cd4d', 'CTPT', '[\"Đến Homestay Hoàng Phúc – hệ thống Kytucxa Q7 rẻ nhất Sài Gòn với những căn phòng đẹp lung linh chuẩn 2 sao, đa dạng tiện nghi và bao trọn toàn bộ các chi phí (cam kết 100% không phát sinh).\",\"CHỈ 9️⃣0️⃣0️⃣.0️⃣0️⃣0️⃣/ THÁNG( KM 200K tháng đầu chỉ còn 7️⃣0️⃣0️⃣.0️⃣0️⃣0️⃣/ THÁNG )\",\"TIỆN ÍCH NỔI TRỘI TẠI ĐÂY:\",\"Giường tầng riêng tư, có tủ đồ, móc treo thông minh\",\"Máy lạnh inverter, wifi tốc độ cao\",\"Nhà vệ sinh riêng, sạch sẽ\",\"Nhân viên dọn phòng hằng ngày\",\"Tự do dùng máy giặt,bình lọc nước\",\"Khu để xe rộng, được camera giám sát.\",\"⏰ ⏰ môi trường văn minh\",\"Ngoài ra còn có:\",\"Camera An ninh, quản lý tâm huyết.\",\"Không gian bếp lớn đầy đủ thiết bị.\",\"Có khu phơi quần áo riêng.\",\"Vị trí ở trung tâm, mức sống dễ chịu, thuận lợi đi lại và ăn uống và rất nhiều các chi nhánh để các chọn lựa gần chỗ làm nơi học.\",\"Địa chỉ các cơ sở chi nhánh KTX:\",\"️CN1: 34 đường 36, P. Tân Quy, Q.7\",\"Các chi nhánh khác:\",\"️CN2: 1134/14A Huỳnh Tấn Phát, Q.7\",\"️CN3: Hẻm 350 Huỳnh Tấn Phát, Q.7\",\"️CN4: 233/11/6 Nguyễn Trãi, P2, Q.5\",\"️ CN5: 84 Nguyễn Tất Thành, Q.4\",\"CÒN CHẦN CHỜ GÌ NỮA NHANH TAY LIÊN HỆ CHO MÌNH 1 CHỖ\",\"Điện thoại: 0931313570\"]', '0be161c0-a10d-4229-b1c6-1d0818023592', '7873c539-fea7-4e18-ba83-36e23cd3359c', '2ca581bc-c17f-4402-8499-ddc89b45cd34', '2022-12-21 07:43:22', '2022-12-21 07:43:22'),
