('8562288a-b5a5-4956-b4fc-2f9da039e018', 'Cho thuê căn hộ 65m2 có ban công đầy đủ nội thất gần Vòng xoay Lê Quang Định & đường Phạm Văn Đồng', '3', 'XTH9', 'Địa chỉ: Đường Thích Bửu Đăng, Phường 1, Quận Gò Vấp, Hồ Chí Minh', '3af02d5f-e49f-4e28-9b11-1b7edb48ebe8', 'CTCH', '[\"Giáp Bình Thạnh,Phú Nhuận,Tân BÌnh gần Sân bay gần các trường ĐH IUH, VLU,...\",\"Gần chợ, BHX, Nhà thuốc, CH Tiện Lợi,...\",\"Nội thất full gồm: Tủ lạnh, máy giặt riêng trong phòng, máy nước nóng, máy lạnh x2, tủ quần áo, bộ bàn ghế, nệm, giường, kệ bếp rộng rãi, tủ bếp.\",\"Cửa sổ lớn thoáng mát.\",\"Ban công lớn rộng rãi.\",\"Dọn vào ở ngay, vệ sinh sạch sẽ.\",\"Có khoá vân tay, giờ giấc tự do, không chung chủ.\",\"Giặc free, xe free 2 chiếc.\",\"Không giới hạn người ở, thích hợp cho hộ gia đình, hoặc nhóm sinh viên.\"]', 'ab720134-815a-41d9-aef4-ebfa7dacd4fc', 'b8ba1f3e-b3c7-4ca9-a8b8-6bfa8b19c3fe', '6b8efffc-9972-4514-b943-7fa5321c81cf', '2022-12-21 07:42:07', '2022-12-21 07:42:07'),
('8e4f7f5d-e085-4082-af35-3d0f83e3318f', 'Phòng tiện nghi Ban Công thoáng có GÁC, 25M -Kế Đại Học Văn Hiến - Âu Cơ', '4', 'HQV1', 'Địa chỉ: 618/32/8 Đường Âu Cơ, Phường 10, Quận Tân Bình, Hồ Chí Minh', 'e1dd3156-d2ec-4212-a1f9-39214c236039', 'CTPT', '[\"Cho thuê phòng trọ tiện nghi BAN CÔNG có GÁC giá 4.5tr với diện tích: 25m. Phòng có 2 cữa sổ, 2 ban công, 2 lối đi riêng biệt NGAY ĐẠI HỌC VĂN HIẾN - ÂU CƠ\",\"+ Vị trị: Nằm ngay trung tâm quận Q.Tân Bình giáp các quận 10, 11, Tân Phú .....\",\"* Đối diện bệnh viện Quận Tân Phú, nhà hàng tiệc cưới Bạch Kim\",\"* Kế bên đường Đồng Đen, giáp chung cư Bàu Cát\",\"+ Tiện nghi mới có sẵn:\",\"* Bếp nấu ăn hiện đại, tolet riêng và ban công rộng thoáng mát\",\"*Máy giặt dùng chung 2 cái, mỗi tầng đều có máy giặt và chỗ phơi đồ rộng rãi\",\"* Giường gỗ, nệm cao su (Nhu cầu)\",\"* Tủ lạnh 160L\",\"* Tủ quần áo gỗ cao cấp (nhu cầu)\",\"* Bàn + ghế làm việc (nhu cầu)\",\"+ Phụ vụ chuyên nghiệp:\",\"* Có camera quan sát 24/24, ra vào bằng vân tay đảm bảo an toàn\",\"* Có chỗ để xe rộng rãi thoải mái\",\"* Dọn về sinh 3lần/ tuần\",\"* Giờ giấc tự do, chìa khóa trao tay.\"]', '2a7b17f7-24c8-492b-94c0-43f528b929ef', '1de3101a-83fb-408d-80db-3f18a3bff7f9', 'a4d269c0-66df-429d-bade-a9414d0b2c76', '2022-12-21 07:43:22', '2022-12-21 07:43:22'),
