('efba1e44-66cb-4e03-b9d3-f5b4a54bafff', 'Cho thuê nhà hẻm 8m Tô Hiệu, 70m2,4 tầng 15trieu Tân Phú', '0', 'BVM6', 'Địa chỉ: Đường Tô Hiệu, Phường Hiệp Tân, Quận Tân Phú, Hồ Chí Minh', 'e81a48a9-f8f5-4f6f-a255-f2d0bfe14628', 'NCT', '[\"Cho thuê nhà , 68m2,4 tầng 15trieu , Tô Hiệu,Tân Phú\",\"Nhà cho thuê Vi trí đẹp, nhà đẹp DT 4x18m, trệt,2 lầu và sân thượng,3 phòng ngủ,2 tolet\",\"_ Nhà đẹp vào ở ngay tiện ở làm vpcty...kinh doanh online...\",\"_ Tiên ích ngập tràn...\",\"Chỉ 15 triệu còn thương lượng cho khách thiện chí\",\"Miễn trung gian\",\"Alo 0765301820\"]', '32b5a6e9-b31f-433d-aec1-56f0fe000a2e', '6c342282-841d-49e2-bcea-0ae08df3c5f2', '20a1ff41-1aa3-45f8-807e-1bd3bc14e5ba', '2022-12-21 07:42:49', '2022-12-21 07:42:49'),
('f1c785d5-9058-4e58-ac8c-5f3c7622c7c8', 'Cho thuê phòng trọ cao cấp tại 64 Trương Văn Bang - Bình Trưng Tây', '3', 'DGT0', 'Địa chỉ: 64 Đường Trương Văn Bang, Phường Bình Trưng Tây, Quận 2, Hồ Chí Minh', 'c485a63b-8dbc-47b6-b3eb-ef22326388a1', 'CTPT', '[\"Cho thuê phòng đẹp, giá rẻ, an ninh tốt tại Bình Trưng Tây, Quận 2\",\"Diện tích: 16-30m2. \",\"Phòng mới xây, cao cấp như khách sạn, đầy đủ nội thất (giường, tủ), vệ sinh khép kín, có máy lạnh, nước nóng năng lượng mặt trời, nhà để xe. Khu an ninh, yên tĩnh, thoáng mát, cách Quận 1 chỉ 10 phút đi xe máy.\",\"Giá: từ 3 triệu/tháng - 3.5 triệu/tháng\",\"Điạ chỉ: 64 Trương Văn Bang - Bình Trưng Tây - Quận 2 (cạnh cầu Giồng Ông Tố 2)\",\"Liên hệ: 0943773920 (A.Hùng).\"]', 'd034b194-d016-4188-9700-1e4a82005ca7', '668c580a-fc31-4686-8e5c-cc8918994c17', 'ecc82d39-3424-4ef8-8ddd-36022cfee744', '2022-12-21 07:43:22', '2022-12-21 07:43:22'),
('f30ae861-ac35-478a-9d96-0ad578bfe480', 'Căn hộ 2PN -1p khách giá 8,5 triệu/tháng', '4', 'KFV1', 'Địa chỉ: 3/2, Phường 8, Quận 10, Hồ Chí Minh', 'b8c39aae-4004-4aaa-a015-dc99849c1360', 'CTCH', '[\"Cho thuê căn hộ đường 3/2- Quận 10. 2PN -1 p khách . Nội thất 2 máy lạnh, 1 tủ lạnh, 1 máy giặc. 2 giường nệm. 2 tủ quần áo. 1 máy nước nóng lạnh. Có ban công thoáng mát. Hẻm xe hơi an ninh. Giá thuê 8,5triệu. Hỗ trợ tháng đầu 1triệu. Liên hệ chủ nhà 0983671379\"]', 'e5e406a2-61b2-4b28-9cf1-c6691fd54c16', '4fbe87c1-f7a1-45b5-98e8-37f433eb0bf0', 'ea5752fc-53d1-437e-bf1e-31faf8ff6c25', '2022-12-21 07:42:07', '2022-12-21 07:42:07'),
('f6f218be-c64f-4d22-bdc3-5bf79883a0ae', 'Cho thuê căn hộ 2PN ngay trung tâm Tân Bình', '3', 'BQW8', 'Địa chỉ: Đường Cộng Hòa, Phường 12, Quận Tân Bình, Hồ Chí Minh', 'af5d1fad-1127-47a4-aecb-bf0af50d1518', 'CTCH', '[\"Cho thuê căn hộ 2PN khép kín riêng biệt. Ngay cộng hoà tân bình. Khu k200. Gần sân bay. Hoàng hoa thám.. tiện đi lại. Khu hẻm xe hơi đậu thoải mái. Diện tích 70m2. Giá thuê 7tr/tháng. ( số lượng 3 căn) Liên hệ chính chủ 0983671379\"]', '3a7d9666-97ac-4bed-9f57-a94dc63eb131', 'ceb588b8-9f9a-4da6-85ef-e697051617d5', 'cc4c8e6c-87c0-4c0b-8571-656d952d4776', '2022-12-21 07:42:07', '2022-12-21 07:42:07'),
('f8c3d8bd-1127-47d0-a97e-c32a7254334b', 'Căn hộ 2Pn nội thất đầy đủ quận 1', '4', 'DHG0', 'Địa chỉ: Đường Trần Đình Xu, Phường Cầu Kho, Quận 1, Hồ Chí Minh', '1bbff881-236a-4cc1-81ec-ed7f378db0c6', 'CTPT', '[\"Cho thuê căn hộ ( phòng) 2 phòng ngủ. Nội thất đầy đủ. Diện tích 50m2. Vị trí thuận tiện đi lại đường Trần Đình Xu. Gần Trần Hưng Đạo. Nguyễn Trãi, phố đi Bộ Bùi Viện. Gia 7tr. Liên hệ chính chủ 0983671379 .\"]', '7cb2062e-5bdb-4ea6-b3c3-3ea5886cbbe4', 'feffcb19-4eb6-48fa-a294-7adc7a98ba95', 'edd21f97-5efe-44c8-a5d3-e956823bedf9', '2022-12-21 07:43:22', '2022-12-21 07:43:22'),
('f9819830-1f4e-4409-9844-9bbce93c2616', 'CHDV 55m2 - full nội thất - sàn gỗ - thang máy (KM: giảm 500k 2 tháng đầu)', '3', 'GBY0', 'Địa chỉ: 381/13 Tân Hòa Đông, Phường Bình Trị Đông, Quận Bình Tân, Hồ Chí Minh', 'cb2ee3ac-d450-411a-8614-0dcd46b1687a', 'CTCH', '[\"Căn hộ mới 100%\",\"Nội thất - full nội thất: Tủ, gường, nệm, bàn, ghế, tủ lạnh, kệ bếp, máy lạnh inverter\",\"Nhà vệ sinh sử dụng trang thiết bị cao cấp - nước nóng\",\"Tòa nhà có thang máy - khóa vân tay - camera phủ khắp nhà - tòa nhà chỉ có 08 phòng nên rất ổn định và an ninh, yên tĩnh\",\"Phí dịch vụ: nước 100k/người, Wifi, rác. vệ sinh hành lang, máy giặt....: 200k/phòngtháng, điện 3.5k/kwh\",\"Chính chủ cho thuê - miễn tiếp môi giới, công ty quảng cáo.\"]', '1bf2d3e4-dc47-4063-8916-12202ba8c604', '9d072113-ffc8-44b1-b2a4-776512772d42', 'e88c2de2-e001-4c3f-9211-1a9039c55ca1', '2022-12-21 07:42:07', '2022-12-21 07:42:07');
